Lily Carter is your average American girl, all she ever wanted was a piece of the American dream and so she works as many jobs to keep up with her cell phone bills. Sales in a departmental store has proven to be quite the challenge as she finds herself &quot;one dissatisfied customer&quot; away from being fired. Johnny Sins who is also trying to get a piece of the American dream sees an opportunity to get laid.
